import React, {useState} from 'react'

function Test() {
    const [count, setCount] = useState(5);
    const increment = () => setCount(count + 1);
    const name = "Crl";
    return({count, increment, name})
}

export default function Count() {
    const {count, increment, name} = Test();
    return (
        <div>
            <button>{name}</button>
        </div>
    )
}
